(1446, 19, '_flex_content_5_image_seal', 'field_62c464a1fa719'),
(1447, 19, 'flex_content_5_cards_0_copy', '\"Se tornou parte integral do nosso trabalho! Consigo organizar a semana, ver as sprints e discutir os próximos passos, tudo dentro do aplicativo. Além disso, a gestão sempre está ciente do que estamos fazendo no momento!\"'),
(1448, 19, '_flex_content_5_cards_0_copy', 'field_62c464bffa71b'),
(1449, 19, 'flex_content_5_cards_0_photo', '48'),
(1450, 19, '_flex_content_5_cards_0_photo', 'field_62c464c7fa71c'),
(1451, 19, 'flex_content_5_cards_0_name', 'Bruce Wayne'),
(1452, 19, '_flex_content_5_cards_0_name', 'field_62c464d1fa71d'),
(1453, 19, 'flex_content_5_cards_0_title', 'CEO, Wayne Enterprises'),
(1454, 19, '_flex_content_5_cards_0_title', 'field_62c464d5fa71e'),
(1455, 19, 'flex_content_5_cards_1_copy', '\"A facilidade com que posso gerenciar os projetos que estou atuando, fez com que eu conseguisse trabalhar com mais facilidade. Por exemplo, consigo me comunicar mais facilmente e de maneira rápida com os engenheiros de software, economizando muito do tempo de ambos os departamentos.\"'),
(1456, 19, '_flex_content_5_cards_1_copy', 'field_62c464bffa71b'),
(1457, 19, 'flex_content_5_cards_1_photo', '36'),
(1458, 19, '_flex_content_5_cards_1_photo', 'field_62c464c7fa71c'),
(1459, 19, 'flex_content_5_cards_1_name', 'Michelle Jones'),
(1460, 19, '_flex_content_5_cards_1_name', 'field_62c464d1fa71d'),
(1461, 19, 'flex_content_5_cards_1_title', 'Cientista, Stark Industries'),
(1462, 19, '_flex_content_5_cards_1_title', 'field_62c464d5fa71e'),
(1463, 19, 'flex_content_5_cards_2_copy', '\"No governo não temos economia de desafios, mas temos várias coisas que conseguimos controlar! Existem processos que podemos evoluir melhor e refinar. Ferramentas como essa permitem que sejamos e façamos um serviço melhor! Temos desafios aqui na prefeitura, mas somos solucionadores de problemas e o Organizer é essencial.\"'),
(1464, 19, '_flex_content_5_cards_2_copy', 'field_62c464bffa71b'),
